        if (menu == 3) {
            if (adult) {
                System.out.println("White wine");
            } else {
                System.out.println("Lemonade");
            }
        } else if (menu + 1 == 5) {
            if (!adult) {
                System.out.println("Still Water");
            } else {
                System.out.println("Port wine");
            }
        }

        if (5 == menu) {
            System.out.println("The restaurant suggests: Sparkling Water");
        }
    }

