                    } else {
                        System.out.println("Student not found.");
                    }
                    break;
                case 4:
                    list.reportStudents();
                    break;
                case 5:
                    list.clearList();
                    break;
                case 6:
                    System.out.println("Exiting the program.");
                    input.close();
                    return;
                default:
                    System.out.println("Invalid choice. Please try again.");
            }
        }
    }
}

